INSERT INTO `cevest_curso` VALUES (1,'Corte Industrial','ESTE CURSO TEM COMO OBJETIVO ENSINAR TODAS AS ATIVIDADES DE CORTE DE UMA CONFECÇÃO, ABORDANDO DESDE O PLANEJAMENTO E PROGRAMAÇÃO ATÉ A ENTREGA DAS PEÇAS CORTADAS À COSTURA. TAMBÉM SÃO ABORDADOS OS DADOS TÉCNICOS DOS TIPOS DE TECIDOS, NOÇÕES DE CUSTO, GESTÃO DA SALA DE CORTE E MANUTENÇÃO DOS EQUIPAMENTOS',120,16,'2018-12-18 23:26:50.892207',1,1,25,1),(2,'Costura Íntima','O CURSO DE COSTURA ÍNTIMA, TEM COMO OBJETIVO GERAL CRIAR OPORTUNIDADES DE TRABALHO, RENDA E INSERÇÃO NO MERCADO, PROPORCIONANDO A QUALIFICAÇÃO PROFISSIONAL NECESSÁRIA PARA O DESENVOLVIMENTO DE HABILIDADES NAS ATIVIDADES DE COSTURA ÍNTIMA. POR MEIO DE UMA FORMAÇÃO TEÓRICO-PRÁTICA O CURSO OBJETIVA DESENVOLVER HABILIDADES E COMPETÊNCIAS NECESSÁRIAS PARA CONFECÇÃO DE PEÇAS ÍNTIMAS EM NOVE TIPOS DE MÁQUINAS INDUSTRIAIS DIFERENTES MONTANDO DIVERSAS PEÇAS, COMO: CUECAS, CALCINHAS E SOUTIENS',240,16,'2018-12-18 23:34:53.735874',1,1,25,1),(3,'Costura Plana (Costura Reta)','CAPACITAR O ALUNO PARA CONFECÇÃO DE ROUPAS EM TECIDO PLANO. NO FINAL DO CURSO O ALUNO SERÁ CAPAZ DE MONTAR PEÇAS COMO: SAIAS, CALÇAS E CAMISAS',120,16,'2018-12-18 23:37:27.987861',1,1,15,1),(4,'Cartonagem','DESENVOLVER TÉCNICAS PARA APROVEITAMENTO DE PAPÉIS, INCENTIVAR A CONFECÇÃO DE CAIXAS, EMBALAGENS, CARTÕES COM APROVEITAMENTO DE TECIDOS, RENDAS GALÕES, FITAS, ETC.',40,16,'2018-12-18 23:39:41.094668',1,1,12,1),(5,'Artesanato Com Reciclagem','TRANSMITIR AO ALUNO (A) A IMPORTÂNCIA DO MATERIAL RECICLÁVEL E AS POSSIBILIDADES CRIATIVAS DE TRABALHAR COM VARIADOS MATERIAIS, TAIS COMO: TECIDOS, PAPEL, PET, CAIXA DE LEITE E SUCO, PAPELÃO, ETC.',40,16,'2018-12-18 23:42:46.635827',1,1,15,1),(6,'Modelagem Modinha','TEM COMO OBJETIVO CAPACITAR MODELISTAS NA ÁREA DA MODELAGEM EM MALHA (VISCOLYCRA, SUPLEX...) TUDO VAI PARTIR DE UMA BASE DE ONDE SAIRÃO OS MODELOS COMO SAIA, BLUSAS, VESTIDOS, CALÇAS E CASACOS',80,16,'2018-12-18 23:45:33.871665',1,2,15,1),(7,'Modelagem Fitness','TEM COMO OBJETIVO SABER CONSTRUIR BASES DE MOLDES DE ROUPAS DE GINÁSTICA E INTERPRETAR MODELOS A PARTIR DE FOTOS, PEÇAS PRONTAS OU CROQUIS. MODELAGEM INDUSTRIAL COM USO DE TABELAS DE MEDIDAS.',120,16,'2018-12-18 23:47:51.548431',1,2,15,1),(8,'Modelagem Íntima','TEM COMO OBJETIVO SABER CONSTRUIR BASES DE MOLDES DE LINGERIE DIA E  INTERPRETAR MODELOS A PARTIR DE FOTOS, PEÇAS PRONTAS OU CROQUIS. MODELAGEM INDUSTRIAL COM USO DE TABELAS DE MEDIDAS.',120,16,'2018-12-18 23:51:32.913347',1,2,15,1),(9,'Modelagem Plana','TEM COMO OBJETIVO SABER CONSTRUIR BASES DE MOLDES DE ROUPAS DE ROUPA DE TECIDO PLANO E INTERPRETAR MODELOS A PARTIR DE FOTOS, PEÇAS PRONTAS OU CROQUIS. MODELAGEM INDUSTRIAL COM USO DE TABELAS DE MEDIDAS.',120,16,'2018-12-18 23:53:32.635456',1,2,15,1),(10,'Modelagem e Corte Computadorizado (Audaces)','APRENDER AS FERRAMENTAS DO SISTEMA AUDACES (MOLDES – DIGIFLASH E ENCAIXE)',40,16,'2018-12-18 23:55:34.571630',1,2,7,1),(11,'Artesanato Patch Apliquê','DESENVOLVER A TÉCNICA DE APLICAÇÃO DE TECIDOS, FITAS, ADEREÇOS E ACESSÓRIOS VARIADOS EM DIVERSAS PEÇAS, TAIS COMO, TOALHAS DE PRATO/COZINHA, TOALHAS DE MESA, ALMOFADAS, BOLSAS, CAMISAS, ETC. UTILIZAÇÃO DE PONTOS DE BORDADO VARIADOS, AGULHAS DE MÃO, LINHAS E ENTRETELAS',40,16,'2018-12-18 23:56:49.540453',1,1,12,1),(12,'Artesanato Com Aparas','CONFECCÇÃO DE PEÇAS DECORATIVAS E UTILITÁRIAS, UTILIZANDO APARAS E RETALHOS DA INDÚSTRIA DO VESTUÁRIO. (MALHAS, LYCRA, ELÁSTICO, FITAS, RENDA) TODAS AS PEÇAS FEITAS COM TECNICAS DE FUXICO E COSTURAS À MÃO. UTILIZA-SE TAMBÉM MATERIAL PARA RECHEIO DAS PEÇAS (ACRILON, PLUMANTE, ALGODÃO, RESÍDUOS DE FIOS TÊXTEIS)',40,16,'2018-12-18 23:58:31.842371',1,1,12,1),(13,'Oficina De Bolsas E Ecobags','MODELAR E CONFECCIONAR PEÇAS DE TAMANHOS E MODELOS VARIADOS, TAIS COMO, BOLSAS DE MÃO, ECOBAGS, NECESSARIES, ESTOJOS, PORTA-ÓCULOS, ETC. UTILIZAÇÃO DE TECIDOS ADEQUADOS DE ALGODÃO, MATERIAL PARA FORRO (MANTA, ACRILON, NYLON E MALHA DUBLADOS). ACABAMENTOS COM FITAS, BORDADOS, ZÍPERES, VELCRO, BOTÕES E VIÉS.',48,16,'2018-12-19 00:02:25.308837',1,1,12,1),(14,'Modelagem, Corte e Costura','MODELAGEM DE ROUPAS FEMININAS A PARTIR DE BASES INDUSTRIAIS (EX: TAMANHO: 36, 38,40,42...)\r\n* CORTE COM POSICIONAMENTO ADEQUADO NO TECIDO E MARGEM DE COSTURA.\r\n* COSTURA REALIZANDO A MONTAGEM DAS PEÇAS, SEGUINDO NORMAS INDUSTRIAIS, UTILIZANDO A MÁQUINA RETA E OVERLOCK',160,16,'2018-12-19 00:04:27.527742',1,2,15,1),(15,'Bonecas Profissionalizantes','A PARTIR DE MOLDES PRONTOS, DESENVOLVER E CONFECCIONAR BONECAS DE MODELOS E TAMANHOS VARIADOS UTILIZANDO TECIDOS DE ALGODÃO CRU, TECIDOS DE ALGODÃO ESTAMPADOS E COLORIDOS, FITAS, RENDAS, BOTÕES, LÃ E AVIAMENTOS DIVERSOS, VISANDO PROFISSIONALIZAR E TORNAR O ALUNO UM GERADOR DE RENDA',48,16,'2018-12-19 00:06:24.357607',1,1,12,1),(16,'Modelagem Infantil','TEM COMO OBJETIVO CAPACITAR MODELISTAS NA ÁREA DE MODELAGEM INFANTIL. AS BASES SÃO CRIADAS EM CIMA DA TABELA PADRÃO DOS TAMANHOS 2 AOS 12 ANOS. A PARTIR DAS BASES SÃO DESENVOLVIDOS MODELOS DE SAIA, CALÇA, CASACOS E BLUSAS.',80,16,'2018-12-19 00:32:05.699208',1,2,15,1),(17,'Controle de Qualidade para Confecção','O objetivo principal deste curso é, portanto, oportunizar aos participantes conhecimentos sobre o conceito de qualidade e seu processo, os princípios da gestão e as ferramentas da qualidade. Além de\r\nconhecer os requisitos necessários para a implantação e as características de cada etapa componente de um sistema da qualidade.',40,16,'2019-01-08 13:30:53.198864',1,2,15,1),(18,'Informática para Gestão de Confecções','Demonstrar a importância da coleta e tratamento adequado da informação para o sucesso de uma confecção. Serão apresentados alguns programas e aplicativos que auxiliam na gestão, além de definição e exemplos de ERP, CRM, SCM e BI.',24,16,'2019-01-10 16:28:10.547259',1,3,12,1);
/*!40000 ALTER TABLE `cevest_curso` ENABLE KEYS */;
UNLOCK TABLES;

